// Funcin para obtener el nombre del semestre a partir de un mes
function getSemesterName(month) {
    if (month === 0 || month === 1 || month === 2 || month === 3 || month === 4 || month === 5) {
        return 'Ene-Jun'; // Enero a Junio
    } else {
        return 'Jul-Dic'; // Julio a Diciembre
    }
}

// Funcin para obtener el nombre del semestre a partir de un mes
function getSemesterName(month) {
    if (month >= 0 && month <= 5) {
        return 'Ene-Jun'; // Enero a Junio
    } else {
        return 'Jul-Dic'; // Julio a Diciembre
    }
}

// Funcin para agrupar los datos por semestre
function groupDataBySemester(data) {
    const semesters = {};
    data.forEach(item => {
        const year = new Date(item.time).getFullYear();
        const month = new Date(item.time).getMonth();
        const semester = getSemesterName(month);
        const semesterKey = `${year}-${semester}`;
        if (!semesters[semesterKey]) {
            semesters[semesterKey] = [];
        }
        semesters[semesterKey].push(item.value);
    });
    return semesters;
}

// Funcin para calcular el promedio de temperatura por semestre
function calculateAverageBySemester(semesters) {
    const averages = {};
    Object.keys(semesters).forEach(semester => {
        const values = semesters[semester];
        const average = values.reduce((acc, curr) => acc + curr, 0) / values.length;
        averages[semester] = average;
    });
    return averages;
}

